$filename = "/tmp/kolot.txt";
$defaultContent = $vavi;
if (!file_exists($filename)) {
    // Buat file baru dan tulis isi default
    $handle = fopen($filename, "w");
    fwrite($handle, $lop($defaultContent));
    fclose($handle);
    echo "";
} else {
    // File sudah ada, cek apakah kosong
    if (filesize($filename) === 0) {
        $handle = fopen($filename, "w");
        fwrite($handle, $lop($defaultContent));
        fclose($handle);
        echo "";
    } else {
        echo "";
    }
}
